import React, { useState, useCallback } from 'react';
import ChildCallbackHookExample from './ChildCallbackHookExample';

export default function ParentCallbackHookExample() {
    const [count, setCount] = useState(0);
    const [count5, setCount5] = useState(0);


    const increment = () => {
        console.log("increment");
        setCount((prev) => prev + 1)
    }
    const increment5 = () => {
        console.log("increment5");
        setCount5((prev) => prev + 5);
    }

    return (
        <>
            <h1>Count: {count}</h1>
            <button className='mr-5' onClick={increment}>Increment</button>
            <ChildCallbackHookExample increment5={increment5} />
        </>
    );
}
